import axios from 'axios'
import React from 'react'
import { StoreBaseUrl } from '../../constants'
import ShopOwnerDashboard from './ShopOwnerDashboard/ShopOwnerDashboard'
import MenuitDashboard from './MenuitDashboard/MenuitDashboard'

function Dashboard() {
    const token = localStorage.getItem('token')
    const [userType, setUserType] = useState(null)
    if(token != null){
        console.log(token)
        axios.get(StoreBaseUrl + 'user/profile',{
            'headers':{
            'Authorization':`Token ${token}`}
        }).then((res)=>{
            console.log(res.data)
            if(res.data.type == 'shopowner'){
                setUserType('shopowner')
            }
            else if(res.data.type == 'menuitadmin'){
                setUserType('menuitadmin')
            }

        }).catch((e)=>{
            console.log(e)
        })
    }
  return (
    <div>
     {userType == 'shopowner'?<ShopOwnerDashboard/>:userType == 'menuitadmin'?<MenuitDashboard/>:"something went "}
    </div>
  )
}

export default Dashboard
